import React, { useState } from "react";
import { set } from "mongoose";

export default function Hooks() {
    const [count, setcount] = useState(0);

    return (
        <div>
            <p>You clicked {count} times</p>
            <button onClick={()=>setcount(count + 1)}>
                click me
            </button>
        </div>
        )
}
